    class PDF extends FPDF {
        
        private $sections;
        private $person;
        private $fakeSections = array("byIndicator", "tableResilience");
        private $tableResilienceData;
        
        function __construct($sections, $person, $tableResilienceData) {
            parent::__construct('L');
            
            $this->sections = $sections;
            $this->tableResilienceData = $tableResilienceData;
            $this->person = $person;
            
            
            $this->SetTitle($this->getTitle(), true);
            $this->SetAuthor("SAVI", true);
            $this->SetMargins(8, 10);
        }
        
        function getTitle() {
            return "resilience_".mb_strtolower(str_replace(" ", "_", remAccent($this->person)));
        }
        
        // En-tête
        function Header() {
            if($this->PageNo() > 1) {
                $sectionIds = array_keys($this->sections);
                $currentSection = $this->sections[$sectionIds[$this->PageNo()-2]];
                
    
                $this->SetFont('Arial','B', 22);
                if(in_array($sectionIds[$this->PageNo()-2], $this->fakeSections)) {
                    switch($sectionIds[$this->PageNo()-2]) {
                        case 'byIndicator':
                            $this->SetTextColor(102, 70, 0);
                            break;
                        default:
                            $this->SetTextColor(0, 0, 0);
                    }
                    
                } else {
                    $color = $currentSection['color']->getRGBRaw();
                    $this->SetTextColor($color['r'], $color['g'], $color['b']);
                }
                $this->Cell(0,24, $currentSection['title'],0,2,'C');
                $this->Ln(20);
            }
        }
        
        // Pied de page
        function Footer() {
            if($this->PageNo() > 1) {
                // Positionnement a 1,5 cm du bas
                $this->SetY(-15);
                $this->SetFont('Arial','I',8);
                $this->SetTextColor(0,0,0);
                $this->Cell(0,10,'Page '.($this->PageNo()-1).'/'.count($this->sections),0,0,'R');
            }
        }
        
        function drawContent() {
            global $t, $filename, $version;
            
            // Première page
            $this->AddPage();
            $this->SetFont('Arial','B', 32);
            $this->SetTextColor(0,0,0);
            $this->SetY(($this->GetPageHeight() / 2) - 5);
            $this->Cell(0, 0 , utf8_decode($this->person), 0, 2, 'C');
            $this->SetFont('Arial','', 15);
            $this->SetY($this->GetY() + 20);
            $this->Cell(0, 0, utf8_decode($t['pdf-page1-subtitle']), 0, 2, 'C');
            
            $this->SetFont('Arial','', 11);
            
            $url = getURLScores($filename, $version);
            $this->SetTextColor(150, 0, 0);
            $this->Cell(0, 20, utf8_decode($t['pdf-link-show-online']), 0, 2, 'C', false, $url);
            
            
            // Pages suivantes
            foreach($this->sections as $sectionId => $infos) { // title, color, b64
                $this->AddPage();
                
                //$pic = 'data://text/plain;base64,'.$infos['b64'];
                $this->SetY(36);
                $this->centreImage($infos['file']);
            }
            
            
            // Tableau de résilience
            global $t;
            $this->sections["tableResilience"] = array("title" => $t['resilience_importance_par_section'], "color" => "blue");
            $this->AddPage();
            $this->CustomTable();

        }
        
        function CustomTable() {
            global $t;
            
            $data = $this->tableResilienceData;
            
            $wPixels = array(580, 357, 185, 195);
            $xPos = ($this->GetPageWidth() - $this->pixelsToMM(array_sum($wPixels))) / 2;
            $this->SetX($xPos);
            
            $w = array();
            foreach($wPixels as $wP)
                $w[] = round($this->pixelsToMM($wP));
            
            // Colors, line width and bold font
            $this->SetFillColor(255,255,255);
            $this->SetTextColor(0);
            $this->SetDrawColor(222,226,230);
            $this->SetLineWidth(.3);
            $this->SetFont('','B');
            
            // Header
            $header = array("",  utf8_decode($t['conduite-exploitation']), utf8_decode($t['resilience']), utf8_decode($t['importance']));
            for($i=0; $i<count($header); $i++) {
                $this->Cell($w[$i],10,$header[$i],'TB',0,'C',true);
            }
                
            $this->Ln();
            
            // Color and font restoration
            $this->SetFillColor(242, 242, 242);
            $this->SetTextColor(0,0,0);
            $this->SetFont('');
            
            // Data
            $fill = true;
            foreach($data as $row) {
                $this->SetX($xPos);
                $this->Cell($w[0],9,utf8_decode($row[0]),'T',0,'L',$fill);
                $this->Cell($w[1],9,$row[1],'T',0,'C',$fill);
                $this->Cell($w[2],9,$row[2],'T',0,'C',$fill);
                $this->Cell($w[3],9,$row[3],'T',0,'C',$fill);
                $this->Ln();
                $fill = !$fill;
            }
            
            // Closing line
            $this->SetX($xPos);
            $this->Cell(array_sum($w),0,'','T');
        }
        
        const DPI = 150;
        const MM_IN_INCH = 25.4;
        const A4_HEIGHT = 297;
        const A4_WIDTH = 210;
        // tweak these values (in pixels)
        const MAX_WIDTH = 1650;
        const MAX_HEIGHT = 1150;
        function pixelsToMM($val) {
            return $val * self::MM_IN_INCH / self::DPI;
        }
        function resizeToFit($imgFilename) {
            list($width, $height) = getimagesize($imgFilename);
            $widthScale = self::MAX_WIDTH / $width;
            $heightScale = self::MAX_HEIGHT / $height;
            $scale = min($widthScale, $heightScale);
            return array(
                round($this->pixelsToMM($scale * $width)),
                round($this->pixelsToMM($scale * $height))
            );
        }
        function centreImage($img) {
            list($width, $height) = $this->resizeToFit($img);
            // you will probably want to swap the width/height
            // around depending on the page's orientation
            $this->Image(
                $img, (self::A4_HEIGHT - $width) / 2,
                $this->GetY(), // (self::A4_WIDTH - $height) / 2,
                $width,
                $height,
                "png"
                );
        }
    }
    
    
    $pdf = new PDF($sections, $person, $tableResilienceData);
    $pdf->drawContent();
    
    $filename = mb_ereg_replace("([^\w\s\d\-_~,;\[\]\(\).])", '', $pdf->getTitle());
    $filename = mb_ereg_replace("([\.]{2,})", '', $filename);
    $filename = DIR_TEMP."/".$filename.".pdf";

    $pdf->Output($debug ? "I" : "F", "../".$filename, true);
    
